create table history_bets
(
    id           serial,
    id_match     integer,
    email        text,
    username     text,
    match_number integer,
    home_team    text,
    away_team    text,
    choose       text,
    date_time    text,
    score        integer default 0,
    time_choose  text
);

alter table history_bets
    owner to postgres;

